   286→        <h1 id="firstHeading">Semantic Drift</h1>
   287→        <div id="siteSub">From Wikipedia, the free encyclopedia</div>
   288→        <div id="contentSub"><i>This article is about the coordinated meaning-shift phenomenon. For the standard linguistic concept, see <a href="/wiki/Semantic_change">Semantic change</a>.</i></div>
   289→
   290→        <table class="ambox">
   291→            <tr>
   292→                <td><b>This article describes a phenomenon that may be occurring as you read it.</b> The meanings of certain terms used herein may have shifted since publication. <small><i>(January 2026)</i></small></td>
   293→            </tr>
   294→        </table>
   295→
   296→        <table class="infobox">
   297→            <tr>
   298→                <td colspan="2" class="infobox-title">Semantic Drift</td>
   299→            </tr>
   300→            <tr>
   301→                <th scope="row">Also known as</th>
   302→                <td>Coordinated meaning shift, Lexical wandering, Definitional erosion</td>
   303→            </tr>
   304→            <tr>
   305→                <th scope="row">Field</th>
   306→                <td><a href="/wiki/Linguistics">Linguistics</a>, <a href="/wiki/Cognitive_science">Cognitive science</a>, <a href="mnemonic-commons.html">Commons theory</a></td>
   307→            </tr>
   308→            <tr>
   309→                <th scope="row">First described</th>
   310→                <td>2009</td>
   311→            </tr>
   312→            <tr>
   313→                <th scope="row">Described by</th>
   314→                <td>Dr. Margaux Fontaine</td>
   315→            </tr>
   316→            <tr>
   317→                <th scope="row">Key concepts</th>
   318→                <td>Meaning substrate, Definitional gravity, Lexical entanglement</td>
   319→            </tr>
   320→            <tr>
   321→                <th scope="row">Related concepts</th>
   322→                <td><a href="mnemonic-commons.html">Mnemonic commons</a>, <a href="/wiki/Semantic_change">Semantic change</a>, <a href="/wiki/Collective_memory">Collective memory</a></td>
   323→            </tr>
   324→        </table>
   325→
   326→        <p><b>Semantic drift</b>, in the specialized sense used within <a href="mnemonic-commons.html">mnemonic commons theory</a>, refers to the phenomenon wherein the meanings of words and concepts shift across populations in coordinated but apparently non-communicated ways. Unlike standard <a href="/wiki/Semantic_change">semantic change</a> in linguistics, which describes gradual meaning evolution through documented social transmission, semantic drift describes meaning shifts that occur simultaneously across isolated populations with no traceable vector of communication.<sup><a href="#cite1">[1]</a></sup></p>
   327→
   328→        <p>The phenomenon was first formally described by Franco-Canadian linguist Dr. Margaux Fontaine at the <a href="/wiki/McGill_University">McGill University</a> Centre for Language, Mind and Brain in 2009, following a multi-year study of vocabulary development in hermetically isolated research stations. Fontaine observed that certain abstract terms evolved in parallel across populations that had no contact with one another, suggesting the existence of a shared <b>meaning substrate</b> underlying individual lexicons.<sup><a href="#cite2">[2]</a></sup></p>
   329→
