   285→    <div id="content">
   286→        <h1 id="firstHeading">Semantic immune system</h1>
   287→        <div id="siteSub">From Wikipedia, the free encyclopedia</div>
   288→        <div id="contentSub"><i>Not to be confused with <a href="/wiki/Computational_immunology">computational immunology</a> or <a href="/wiki/Immune_network_theory">immune network theory</a>.</i></div>
   289→
   290→        <table class="ambox">
   291→            <tr>
   292→                <td><b>This article describes a theoretical system designed to protect itself from the processes it is meant to study.</b> Recursive instabilities may occur. <small><i>(January 2026)</i></small></td>
   293→            </tr>
   294→        </table>
   295→
   296→        <table class="infobox">
   297→            <tr>
   298→                <td colspan="2" class="infobox-title">Semantic immune system</td>
   299→            </tr>
   300→            <tr>
   301→                <th scope="row">Also known as</th>
   302→                <td>SIS, Lexical immunity, Meaning defense system</td>
   303→            </tr>
   304→            <tr>
   305→                <th scope="row">Field</th>
   306→                <td><a href="temporal-linguistics-engineering.html">Temporal linguistics engineering</a>, <a href="semantic-hygiene.html">Semantic hygiene</a></td>
   307→            </tr>
   308→            <tr>
   309→                <th scope="row">Proposed</th>
   310→                <td>2025</td>
   311→            </tr>
   312→            <tr>
   313→                <th scope="row">Developers</th>
   314→                <td><a href="edinburgh-institute-for-temporal-studies.html">Edinburgh Institute for Temporal Studies</a></td>
   315→            </tr>
   316→            <tr>
   317→                <th scope="row">Key concepts</th>
   318→                <td>Semantic antibodies, Meaning homeostasis, Drift tolerance</td>
   319→            </tr>
   320→            <tr>
   321→                <th scope="row">Status</th>
   322→                <td>Theoretical/Early experimental</td>
   323→            </tr>
   324→            <tr>
   325→                <th scope="row">Related concepts</th>
   326→                <td><a href="semantic-hygiene.html">Semantic hygiene</a>, <a href="semantic-drift.html">Semantic drift</a>, <a href="ghost-vocabulary.html">Ghost vocabulary</a></td>
   327→            </tr>
   328→        </table>
   329→
   330→        <p>A <b>semantic immune system</b> (<b>SIS</b>) is a theoretical self-regulating mechanism within language communities that would automatically detect and respond to unwanted <a href="semantic-drift.html">semantic drift</a>, <a href="lexical-half-life.html">lexical decay</a>, and meaning degradation without requiring continuous external intervention. First proposed by researchers at the <a href="edinburgh-institute-for-temporal-studies.html">Edinburgh Institute for Temporal Studies</a> in 2025, the concept represents an ambitious attempt to move beyond reactive <a href="semantic-hygiene.html">semantic hygiene</a> toward proactive, self-sustaining meaning preservation.<sup><a href="#cite1">[1]</a></sup></p>
   331→
   332→        <p>Drawing analogies from <a href="/wiki/Immune_system">biological immune systems</a>, SIS theory proposes that language communities could develop or be equipped with mechanisms that recognize "foreign" or "pathological" meaning changes and mount appropriate responses to contain or reverse them. Unlike active <a href="temporal-linguistics-engineering.html">temporal linguistics engineering</a> (TLE), which requires deliberate intervention, a mature semantic immune system would operate autonomously, maintaining meaning homeostasis through self-organized processes.<sup><a href="#cite2">[2]</a></sup></p>
   333→
   334→        <div id="toc">
   335→            <h2>Contents</h2>
   336→            <ul>
   337→                <li><span class="tocnumber">1</span> <a href="#Theoretical_foundations">Theoretical foundations</a>
   338→                    <ul>
   339→                        <li><span class="tocnumber">1.1</span> <a href="#Biological_analogy">The biological analogy</a></li>
   340→                        <li><span class="tocnumber">1.2</span> <a href="#Meaning_homeostasis">Meaning homeostasis</a></li>
   341→                    </ul>
   342→                </li>
   343→                <li><span class="tocnumber">2</span> <a href="#Components">Proposed components</a>
   344→                    <ul>
   345→                        <li><span class="tocnumber">2.1</span> <a href="#Recognition">Recognition mechanisms</a></li>
   346→                        <li><span class="tocnumber">2.2</span> <a href="#Response">Response mechanisms</a></li>
   347→                        <li><span class="tocnumber">2.3</span> <a href="#Memory">Immunological memory</a></li>
   348→                    </ul>
   349→                </li>
   350→                <li><span class="tocnumber">3</span> <a href="#Natural_SIS">Natural semantic immune systems</a></li>
   351→                <li><span class="tocnumber">4</span> <a href="#Engineering">Engineering artificial SIS</a></li>
   352→                <li><span class="tocnumber">5</span> <a href="#Pathologies">Semantic autoimmunity and pathologies</a></li>
   353→                <li><span class="tocnumber">6</span> <a href="#Criticism">Criticism and limitations</a></li>
   354→                <li><span class="tocnumber">7</span> <a href="#See_also">See also</a></li>
   355→                <li><span class="tocnumber">8</span> <a href="#References">References</a></li>
   356→            </ul>
